@Sanjay_Dixit Manusmriti 10:65: “The brahman can become shudra, as the shudra can be brahmin. So indeed can khsatriya and vaishya change their varna.”

So much for “rigid” “caste” system. An imported word that connotes neither varna, nor ashrama, nor indeed jaati. 

Thanks @Sanjay_Dixit ji🙏🏽
